import styles from "../styles/homepage.module.css"

export default function Home() {
  return <Welcome />
}


function  Welcome() {
  return (
    <div id={styles.welcome}>
    <h1>Welcome to</h1>
    <h1>Chatify</h1>
    </div>
  )
}
